    private void validateAppCustomerCategory(EntityTestCriteria contraints, AppCustomerCategory appcustomercategory) throws SpartanIncorrectDataException, SpartanConstraintViolationException, SpartanPersistenceException {
        if (contraints.getRuleType() == MIN_MAX) {
            appcustomercategory.isValid();
        } else if (contraints.getRuleType() == NOT_NULL) {
            appcustomercategory.isValid();
        } else if (contraints.getRuleType() == REGEX) {
            appcustomercategory.isValid();
        } else if (contraints.getRuleType() == UNIQUE) {
            appcustomercategoryRepository.save(appcustomercategory);
        }
    }

    private List<EntityTestCriteria> addingListOfFieldForNegativeTesting() {
        List<EntityTestCriteria> entityContraints = new java.util.ArrayList<EntityTestCriteria>();
        entityContraints.add(new EntityTestCriteria(NOT_NULL, 1, "customerCategory", null));
        entityContraints.add(new EntityTestCriteria(MIN_MAX, 2, "customerCategory", ""));
        return entityContraints;
    }

    @Test
    public void test5NegativeTesting() throws NoSuchMethodException, SecurityException, IllegalArgumentException, IllegalAccessException, NoSuchFieldException, Exception, SpartanPersistenceException {
        int failureCount = 0;
        for (EntityTestCriteria contraints : this.entityContraint) {
            try {
                AppCustomerCategory appcustomercategory = createAppCustomerCategory(false);
                java.lang.reflect.Field field = null;
                if (!contraints.getFieldName().equalsIgnoreCase("CombineUniqueKey")) {
                    field = appcustomercategory.getClass().getDeclaredField(contraints.getFieldName());
                }
                switch(((contraints.getTestId()))) {
                    case 0:
                        break;
                    case 1:
                        field.setAccessible(true);
                        field.set(appcustomercategory, null);
                        validateAppCustomerCategory(contraints, appcustomercategory);
                        failureCount++;
                        break;
                    case 2:
                        appcustomercategory.setCustomerCategory(contraints.getNegativeValue().toString());
                        validateAppCustomerCategory(contraints, appcustomercategory);
                        failureCount++;
                        break;
                }
            } catch (SpartanIncorrectDataException e) {
                e.printStackTrace();
            } catch (SpartanConstraintViolationException e) {
                e.printStackTrace();
            } catch (SpartanPersistenceException e) {
                e.printStackTrace();
            } catch (Exception e) {
                e.printStackTrace();
            }
        }
        if (failureCount > 0) {
            org.junit.Assert.fail();
        }
    }
